(4031151, '剥製にされたドレイクの頭骨', '', 'ドレイクの頭骨を特殊処理して原型そのまま保存しておいたもの。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031152, '化石研究報告書', '', '化石研究を通じて分かった研究結果を整理したＤｒ.ベティの報告書である。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031153, 'スタンプの涙', '', 'スタンプの樹液が結晶になったもの。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031154, 'エステルの特製ソース', '', 'エリニアに住んでいるエステルの特別なソースである。材料や作り方は公開されていない。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031155, '壊れた鏡のかけら', '', '壊れた鏡のかけらである。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031156, 'きらきらのガラス玉', '', '五色に光っている大きいガラスの玉である。玉の中に「私の友達ユータに」と書いてある。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031157, 'メイプル古書(上)', '', 'メイプルの歴史が書かれている重要な古書の上巻である。オルビス行きの船の中で見つけられた。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031158, 'メイプル古書(中)', '', 'メイプルの中編にはメイプルの成長過程が書かれてある。これからのメイプルの発展を助ける重要なものである。エリニアの魔法使いハインズの家に保管されている。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031159, 'メイプル古書(下)', '', '現在に至るまでのメイプルの歴史が書かれている古書の下巻である、メイプルの邪悪なモンスターが登場するまでの歴史が書かれている重要なものである。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, '');
