(4031160, '名誉の勲章', '', '補佐官ティグンからもらった名誉の勲章である。任務を完遂したという証票になるから、ヘネシスのジェイに持って行ってあげよう', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031161, '古いネジ', '', '使えなくなった箱をぶちこわして回収した古くなったネジである。リサイクルできるかな。', 100, '2.0', 2, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031162, '古い木板', '', '使えなくなった箱をぶちこわして回収した古くなった木の板である。リサイクルできるかな。', 100, '2.0', 2, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031163, '飛翔の秘薬', '', '神秘な材料で作られた妖精の秘薬である。この薬を飲むと空を飛べるというウワサがあるが、妖精の仲間達の間で伝えられていることで確認されたことはない。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
(4031164, 'ワニカワ袋', '', '丈夫なワニの皮で作られた袋である。何でも入れることができるほど丈夫そうに見える。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
