(4031221, '特殊な地球防衛本部帰還カプセル', '', '普通の帰還カプセルとは違って他の大陸からもすぐ地球防衛本部に帰還できるように特殊製作されたワープカプセル。地球防衛本部に所属されている隊員のみ使用できる。', 100, '1.0', 1, 0, 512, 0, 0, 0, 0, 0, '', '', 0, '', 0, '', 0, ''),
